// import Pokemon from "./Pokemon";

function PokemonList(props) {
  const item = props.data.map((dataItem, i) => {
    return (
      <li key={i}>
        <Pokemon dataItem={dataItem} />
      </li>
    );
  });
  return (
    <div>
      <ul>{item}</ul>
    </div>
  );
}
export default PokemonList;
